import React from 'react';


class Title extends React.Component {
    render() {
        return (
            <React.Component>
                {/* Title for web app */}
                <p id="prefix" className="title">Hello, my name is</p>
                <p id="name" className="title">Rudy L. Pichola-Flores</p>
                <p id="description" className="title">I'm a software engineer based in Chicago, IL specializing in Computer Networks and Cybersecurity. Currently working at Northwestern Settlement as a web developer.</p>
            </React.Component>
        );
    }
}

export default Title;
